import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const dummyData = [
  { title: "Naresh", notes: "i am not good boy", expand: true },
  { title: "Naveen", notes: "i am not good boy", expand: true },
  { title: "Dikson", notes: "i am not good boy", expand: false },
]

class App extends Component {
  render() {
    return (
      <div>
        <div className="d-flex p-3 bg-secondary text-white m-2">  
          <button type="button" className="btn btn-primary btn-sm">Add New Note</button>
        </div>
          <form>
          <div className="form-group">
            <div className= "titleArea">
              <input type="text" className="title" name="title" placeholder="Note Title"></input>
              <button type="button" className="btn btn-sm deleteBtn">‚ùå</button>
            </div>
            <textarea className="form-control notes" rows="10"></textarea>
          </div>
          <div class="search-wrapper">
              <form>
                  <input type="text" name="focus" required class="search-box" placeholder="Enter search term" />
                  <button class="close-icon" type="reset"></button>
              </form>
          </div>
        </form>
      </div>
    );
  }
}

export default App;
